import React from 'react';
import { Box, Typography, Grid, Paper, LinearProgress } from '@mui/material';
import { styled } from '@mui/material/styles';
import LightbulbIcon from '@mui/icons-material/Lightbulb';
import ThermostatIcon from '@mui/icons-material/Thermostat';
import SecurityIcon from '@mui/icons-material/Security';
import AcUnitIcon from '@mui/icons-material/AcUnit';

const StatusCard = styled(Paper)(({ theme }) => ({
  padding: theme.spacing(2),
  height: '100%',
  display: 'flex',
  flexDirection: 'column',
  background: theme.palette.mode === 'dark' 
    ? 'linear-gradient(45deg, #9c27b0 30%, #ba68c8 90%)'
    : 'linear-gradient(45deg, #2196f3 30%, #64b5f6 90%)',
  color: '#fff',
  transition: 'transform 0.2s',
  '&:hover': {
    transform: 'scale(1.02)',
  },
}));

interface DashboardProps {
  devices: {
    lights: boolean;
    thermostat: boolean;
    security: boolean;
    ac: boolean;
  };
  stats: {
    activeDevices: number;
    totalDevices: number;
    energyUsage: number;
  };
}

const Dashboard: React.FC<DashboardProps> = ({ devices, stats }) => {
  return (
    <Box sx={{ pb: 7 }}>
      <Typography variant="h4" gutterBottom>
        Обзор системы
      </Typography>
      
      <Grid container spacing={3} sx={{ mb: 4 }}>
        <Grid item xs={12} md={6}>
          <Paper sx={{ p: 2 }}>
            <Typography variant="h6" gutterBottom>
              Статистика
            </Typography>
            <Box sx={{ mb: 2 }}>
              <Typography variant="body2" color="text.secondary">
                Активные устройства: {stats.activeDevices} из {stats.totalDevices}
              </Typography>
              <LinearProgress 
                variant="determinate" 
                value={(stats.activeDevices / stats.totalDevices) * 100} 
                sx={{ mt: 1 }}
              />
            </Box>
            <Typography variant="body2" color="text.secondary">
              Потребление энергии: {stats.energyUsage} кВт/ч
            </Typography>
          </Paper>
        </Grid>
      </Grid>

      <Grid container spacing={3}>
        <Grid item xs={12} sm={6} md={3}>
          <StatusCard>
            <Box display="flex" alignItems="center" mb={1}>
              <LightbulbIcon sx={{ mr: 1 }} />
              <Typography variant="h6">Освещение</Typography>
            </Box>
            <Typography variant="body2">
              {devices.lights ? 'Включено' : 'Выключено'}
            </Typography>
          </StatusCard>
        </Grid>
        <Grid item xs={12} sm={6} md={3}>
          <StatusCard>
            <Box display="flex" alignItems="center" mb={1}>
              <ThermostatIcon sx={{ mr: 1 }} />
              <Typography variant="h6">Термостат</Typography>
            </Box>
            <Typography variant="body2">
              {devices.thermostat ? 'Включено' : 'Выключено'}
            </Typography>
          </StatusCard>
        </Grid>
        <Grid item xs={12} sm={6} md={3}>
          <StatusCard>
            <Box display="flex" alignItems="center" mb={1}>
              <SecurityIcon sx={{ mr: 1 }} />
              <Typography variant="h6">Безопасность</Typography>
            </Box>
            <Typography variant="body2">
              {devices.security ? 'Включено' : 'Выключено'}
            </Typography>
          </StatusCard>
        </Grid>
        <Grid item xs={12} sm={6} md={3}>
          <StatusCard>
            <Box display="flex" alignItems="center" mb={1}>
              <AcUnitIcon sx={{ mr: 1 }} />
              <Typography variant="h6">Кондиционер</Typography>
            </Box>
            <Typography variant="body2">
              {devices.ac ? 'Включено' : 'Выключено'}
            </Typography>
          </StatusCard>
        </Grid>
      </Grid>
    </Box>
  );
};

export default Dashboard;
